import React, { useState } from "react";
import ReactMapGL, { Marker, Popup, GeolocateControl, NavigationControl, FullscreenControl } from "react-map-gl";
import { TitleBar } from 'react-desktop/windows';
import * as pointData from "./data/sample_data.json";

export default function App() {
  const [viewport, setViewport] = useState({
    latitude: 28.064570,
    longitude: -80.623040,
    width: "100vw",
    height: "100vh",
    zoom: 16
  });

  const [selectedPoint, setselectedPoint] = useState(null);

  const navControlStyle = {
    right: 10,
    bottom: 10,
  };

  const geolocateStyle = {
  position: "absolute",
  top: 0,
  right: 0,
  margin: 10
  };


  return (
    <div>
      <div style={{
      display: "block", width:1500, paddingLeft:0
      }}>
      <h4>Wifi performance map</h4>
      <TitleBar
      title= "Performance map"
      isMaximized="false"
      background="orange"
      />
      </div>
      <ReactMapGL
        {...viewport}
        mapboxApiAccessToken={"pk.eyJ1IjoiZHJlc2VuZGVzIiwiYSI6ImNsYWczYnVxdDA5aXEzd21vdmlzY3lmemUifQ.szVCqwXEpk5-FpJFutAFCg"}
        mapStyle="mapbox://styles/mapbox/streets-v11"
        onViewportChange={viewport=> {
          setViewport(viewport)}}
      >


        <NavigationControl style={navControlStyle} />

        <GeolocateControl
          style={geolocateStyle}
          positionOptions={{ enableHighAccuracy: true }}
          trackUserLocation={true}
        />


      </ReactMapGL>
    </div>
  );
}
